import React from 'react'
// import "./molecule.css";
import {
    Box,
    Container,
    makeStyles,
} from '@material-ui/core';
import { VerticalTab } from '../../molecules'
import { MainContainer } from '../../atoms';
import Fade from 'react-reveal/Fade';



const useStyles = makeStyles((theme) => ({
    whiteBox: {
        marginTop: '20%',
        paddingBottom: '8%',
    },
    expand: {
        color: 'black'
    },
    blueBox: {
        background: '#182AC3',
    },
    blueBoxContainer: {

    }
}))

export function Expanding() {
    const classes = useStyles();



    return (
        <>
            <Box style={{position:'relative'}}>
                <MainContainer>
                    <Container className={classes.whiteBox}>
                        <Fade left>
                            <h3 className={classes.expand}>EXPANDING THE CORE  <br /> OF OUR PRIMARY OFFERINGS</h3>
                        </Fade>
                    </Container>
                </MainContainer>
                <Box className={classes.blueBox}>

                    <MainContainer>
                        <Fade right>
                            <Container fixed className={classes.blueBoxContainer} style={{ padding: '1% 0%' }}>
                                <VerticalTab />
                            </Container>
                        </Fade>
                    </MainContainer>

                </Box>
            </Box>
        </>
    )
}
